// pages/instructor/instructor.js
Page({

  /**
   * 页面的初始数据
   */
  data: {
    intro: [
      {
        text:'主界面介绍',
        content: [
          '① 彩种名称。',
          '② 可选择直选、组选。',
          '③ 百、十、个位预选位，默认情况下全选。',
          '④ 对预选位快速选择，全选、反选、清除号码。',
          '⑤ 所有过滤指标，通过设置若干条件过滤出想要的号码。 每个条件的定义在打开条件页后，点击“?”按钮弹查看。',
          '⑥ “更多“点击后展开更多条件，因彩种类别数量不等。',
          '⑦ 设置好条件后，点击过滤→查看过滤出的号码结果。',
          '⑧ 复制号码：可复制过滤结果中的号码。 清空条件：清除当前已设置的条件和过滤结果。 点击过滤：选择好条件，点击过滤，即可获取到号码。 机选20注：点击后系统随机过滤出20注号码。'
        ],
        show:true,
        picOff:true,
        img: 'data:image/jpg;base64,'
      },
      {
        text: '条件页介绍',
        picOff: true,
        picOff02: true,
        content: [
          '如下图，示例：胆码组-出现次数说明',
          '① 胆码组1：随便选择几个号码球，如1~7；',
          ' ② 出现：0、1、2、3个 0个即该胆码组中的数字在过滤号码中一个不出现，1个即该胆码组中的数字在每个过滤号码中最多出现1个，其他依次类推。如胆码组为567，出现次数为1个，则过滤后的每注号码中5、6、7最多出现1个，不会出现55、555，66、666，77、777这样的号码。'
        ],
        show: false,
        img: 'data:image/jpg;base64,'
      },
      {
        text: '常用术语',
        content: [
          '012路：按除3余数来划分的数字三分法，0路为除3余0的号码0369，1路为除3余1的号码147，2路为除3余2的号码258。',
          '大中小：按数字的大小来划分的数字三分法，小号012，中号3456，大号789。',
          '大小：按数字的大小来划分的数字二分法，小号01234，大号56789。',
          '质合：按数字的质合属性来划分的数字二分法，通常将1默认为质数，质数12357，合数04689。',
          '奇偶：按除2余数来划分的数字二分法，除2余1的为奇数13579，除2余0的为偶数02468。',
          '和值：号码的各个数字相加的总和，如号码为329，和值为3+2+9=14。',
          '和尾：和尾就是和值的尾数，如号码为329，和值为3+2+9=14，和尾为4。',
          '跨度：号码中最大数字减最小数字的值为跨度，如号码为329，9-2=7，那么跨度值为7。 ',
          '相对大中小：最大数是指号码中最大的那个数字，中间数是指号码中第二大的数字，最小数是指号码中最小的数字；组三号码中，最大数和中间数相同时此数字既是最大数也是中间数，最小数和中间数相同时此数字既是中间数也是最小数；豹子号码，最大数，中间数，最小数为同一数字。 胆码组：1-9个数字组成的数字组合，这组数字中函盖几个不确定出的数字，组合起来确定出号。'

        ],
        show: false,
      },
    ]
  },
  change: function (e) {
      var that =this;
      var ind = e.target.dataset.t;
      var da = that.data.intro;
      for (var s = 0; s < 3; s++) {
        if (ind == s) {
          da[s].show = true;
        } else {
          da[s].show = false;
        } 
      }
      that.setData({
          intro:da
      })
  },
  /**
   * 生命周期函数--监听页面加载
   */
  onLoad: function (options) {
  
  },

  /**
   * 生命周期函数--监听页面初次渲染完成
   */
  onReady: function () {
  
  },

  /**
   * 生命周期函数--监听页面显示
   */
  onShow: function () {
  
  },

  /**
   * 生命周期函数--监听页面隐藏
   */
  onHide: function () {
  
  },

  /**
   * 生命周期函数--监听页面卸载
   */
  onUnload: function () {
  
  },

  /**
   * 页面相关事件处理函数--监听用户下拉动作
   */
  onPullDownRefresh: function () {
  
  },

  /**
   * 页面上拉触底事件的处理函数
   */
  onReachBottom: function () {
  
  },

  /**
   * 用户点击右上角分享
   */
  onShareAppMessage: function () {
  
  }
})